import React from 'react';
import './ProductList.css';

function ProductList({ products, onView, onDelete }) {
  return (
    <ul>
      {products.map((product) => (
        <li key={product.id}>
          {product.name} - {product.price} - {product.category} - {new Date(product.creationDate).toLocaleDateString()}
          <button className="view" onClick={() => onView(product.id)}>View</button>
          <button className="delete" onClick={() => onDelete(product.id)}>Delete</button>
        </li>
      ))}
    </ul>
  );
}

export default ProductList;
